import { SharedCard } from './SharedCard';
import Illustration_17 from '../../../assets/images/js/Illustration_17';

export const CardReminder = props => {
  const description = 'Set a reminder for next evaluation after 90 days';
  const image = <Illustration_17 />;
  const navLink = 'HomeScreen';

  return (
    <>
      <SharedCard image={image} title={title} description={description} navLink={navLink} nextButton={nextButton}/>
    </>
  );
};
